import React from "react";

const VRRoom = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        غرفة الواقع الافتراضي
      </h1>
      <p className="text-gray-600">صفحة الواقع الافتراضي قيد التطوير...</p>
    </div>
  );
};

export default VRRoom;
